import React from "react";
import { Routes, Route } from "react-router-dom";
import HomeScreen from "./screens/HomeScreen";
import ContactScreen from "./screens/ContactScreen";
import ConfirmMessage from "./screens/ConfirmMessage";
import CarsScreen from "./screens/CarsScreen";
import Loader from "./components/Loader";

function App() {
  return (
    <div className="App">
      <Routes>
        <Route path="/" element={<HomeScreen />} />
        {/* <Route
          path="/contact"
          element={
            confirmSendMessage ? (
              <Navigate to="confirm-send-message" />
            ) : (
              <ContactScreen setConfirmSendMessage={setConfirmSendMessage} />
            )
          }
        /> */}
        <Route path="/contact" element={<ContactScreen />}>
          <Route path="confirm-message" element={<ConfirmMessage />} />
        </Route>
        <Route path="/cars" element={<CarsScreen />} />
        <Route path="/cars/search/:keyword" element={<CarsScreen />} />
        <Route path="/loader" element={<Loader />} />
        {/* <Route path="/contact/confirm-message" element={<ConfirmMessage />} /> */}
      </Routes>
    </div>
  );
}

export default App;
